import React, { useEffect, useState } from 'react'
import axios from 'axios'
import { Link } from 'react-router-dom';

export default function AppComponent() {
    const [post,setPost] = useState([]);
    useEffect(() => {
        axios.get("http://localhost:5000/list").then((Response) => {
            console.log(Response);
            setPost(Response.data);
        })
    })
    return
     (
        <>
            <h1>This is App Component</h1>
            <table className="table-bordered p-3 w-50 m-30 " cellPadding={15}>
                <tr>
                    <th>First Name</th>
                    <th>Last Name</th>
                    <th>Email</th>
                    <th>Password</th>
                    <th colSpan={2}>Action</th>
                </tr>
                {
                    post.map((e) => {
                        return (
                            <>
                                <tr>
                                    <td>{e.fname}</td>
                                    <td>{e.lname}</td>
                                    <td>{e.email}</td>
                                    <td>{e.password}</td>

                                    <td><button className='btn btn-primary'>Edit</button></td>
                                    <td><button className='btn btn-danger'onClick={deleteHandler}>Delete</button></td>
                                </tr>
                            </>
                        )
                    })
                }

            </table>
            <a><Link to='/add'> Add new Student</Link></a>
        </>
    )
}
